import './Register.css'

import React from "react";


function Register({ movie }) {
    return (
        <div className='register'>

            <div className='auth-page'>
                <form className='auth-page__form'>
                    <h2 className='auth-page__title'>Добро пожаловать!</h2>
                    <input name="Name" type="text" className="popup__input popup__input_type_login" id="email" placeholder="Имя" minLength="6" maxLength="40" required />
                    <input name="Email" type="email" className="popup__input popup__input_type_login" id="email" placeholder="Email" minLength="6" maxLength="40" required />
                    <input name="Password" type="password" className="popup__input popup__input_type_login" id="password" placeholder="Пароль" minLength="6" maxLength="40" required />
                    <button type="submit" className='auth-page__button'>Зарегистрироваться</button>
                    {/* <Link className='auth-page__link' to='/sign-up'>Уже зарегистрированы? Войти</Link> */}
                </form>
            </div>
        </div>
    )
}

export default Register;
